Cloudwei.NodeRenderer = function(nodeData){
	this._initialize(nodeData);
};

Cloudwei.NodeRenderer.prototype = {

	_initialize: function(nodeData){
		Kinetic.Group.call(this, {});
		var imageObj = new Image();
		if(nodeData.data.type=='host')
			imageObj.src = 'data:image/png;base64,';
		else if(nodeData.data.type=='switch')
			imageObj.src = 'data:image/svg+xml;base64,';
		else if(nodeData.data.type=='storage')
			imageObj.src = 'data:image/png;base64,';
        else
            imageObj.src = nodeData.data.imageUrl;
        var nodeIcon = new Kinetic.Image({
	    	image: imageObj,
	      	x: 0,
	      	y: 0,
	      	width: 60,
	      	height: 60
	    });
        var textX = 30-(nodeData.data['name'].length*7)/2
        var text = new Kinetic.Text({
            text: nodeData.data['name'],
            x:textX,
        	y:60,
        	fill: 'black',
            align: "center"
        });
	    this.setWidth(60);
	    this.setHeight(60);
	    this.add(nodeIcon);
	    this.add(text);
	}

};
Kinetic.Util.extend(Cloudwei.NodeRenderer, Kinetic.Group);